import './App.css'
import { Nav, Navbar } from "react-bootstrap"
import { Link } from 'react-router-dom'
import { useEffect, useState } from "react"
import { useLocation } from 'react-router-dom';

const NavBar = () =>{
    const token =  localStorage.getItem('auth_token')
    const username =  localStorage.getItem('user_name')
    const usermail =  localStorage.getItem('user_email')
    const userrole =  localStorage.getItem('user_role')
    const [isActive, setActive] = useState(false);
    const [item, setItem] = useState("animated-icon3");
    const [bar, setBar] = useState('navbar-collapse collapse');
    const location = useLocation();
    useEffect(()=>{},[location])


    var loggedIn = false;

    if (token != null){
        loggedIn = true;
    }

    function open() {
        setActive(!isActive)
        if (isActive) {
            setItem("animated-icon3")
            setBar('navbar-collapse collapse')
        }
        if (!isActive) {
            setItem("animated-icon3 open")
            setBar('navbar-collapse collapse show')
        }
    }

    if(!loggedIn){
        return(
            <div className="sb-nav-fixed customFont" >

                <nav className="navbar navbar-expand-md navbar-dark bg-dark shadow-sm">
                <div className="container-fluid" >

                    <a className="navbar-brand" href="/">
                        Autotek
                    </a>
                    <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="{{ __('Toggle navigation') }}">
                        <span className="navbar-toggler-icon"></span>
                    </button>

                    <div className="collapse navbar-collapse" id="navbarSupportedContent">
                        <ul className="navbar-nav me-auto">

                        </ul>


                        <ul className="navbar-nav ms-auto">
                                    <li className="nav-item">
                                        <a className="nav-link" href="/prisijungimas">Prisijungimas</a>
                                    </li>
                                    <li className="nav-item">
                                        <a className="nav-link" href="/registracija">Registracija</a>
                                    </li>
                                </ul>

                    </div>
                    </div>

            </nav>
            </div>



        )
    }
    else{
    return(
        <>
        <nav class="navbar navbar-dark bg-dark ">
            <Link to="/" className='nav-link navbar-brand'>
                Saitynai
            </Link>
            <button class="navbar-toggler third-button collapsed" type="button" data-toggle="collapse" data-target="#navbarSupportedContent22"
                aria-controls="navbarSupportedContent22" aria-expanded={isActive} aria-label="Toggle navigation" onClick={() => open()}>
                <div class={item}><span></span><span></span><span></span></div>
            </button>
            <div class={bar} id="navbarSupportedContent23">
                <ul class="navbar-nav mr-auto" >

                                            {/* Admins */}
                                            <li className='nav-item'>
                                                <Link to="/registeradmin" className="nav-link">Register admin</Link>
                                            </li>
                                            <li className='nav-item'>
                                                <Link to="/registerpart" className="nav-link">Register part</Link>
                                            </li>
                                            <li className='nav-item'>
                                                <Link to="/registerspecification" className="nav-link">Register specification</Link>
                                            </li>

                                {/* Users */}
                                <li className='nav-item'>
                                    <Link to="/kompiuteriai" className="nav-link">Kompiuteriai</Link>
                                </li>
                                <li className='nav-item'>
                                    <Link to="/logout" className="nav-link">Logout</Link>
                                </li>

                                {/* Guests */}
                                <li className='nav-item'>
                                    <Link to="/kompiuteriai" className="nav-link">Kompiuteriai</Link>
                                </li>
                                <li className='nav-item'>
                                    <Link to="/register" className="nav-link">Register</Link>
                                </li>
                                <li className='nav-item'>
                                    <Link to="/login" className="nav-link">Login</Link>
                                </li>

                </ul>
            </div>
        </nav>
        </>
        )
    }
}

export default NavBar;
